import styles from './Loading.module.scss'

const Loading = () => {
  return (
    <div className={styles.loading}>
      <div class={styles.load}>
         <div class={styles.part && styles.one}></div>
         <div class={styles.part && styles.two}></div>
         <div class={styles.part && styles.three}></div>
         {/* <div class={styles.part && styles.four}></div> */}
      </div>
    </div>
  )
}

export default Loading
